-- create the database
CREATE DATABASE Movies
GO

-- switch to it
USE Movies
GO

-- create table of actors
CREATE TABLE dbo.Actor(
	ActorID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	FirstName nvarchar(100) NOT NULL,
	FamilyName nvarchar(100) NULL,
	FullName  AS (FirstName+isnull(' '+FamilyName,'')),
	DoB datetime NULL,
	DoD datetime NULL,
	Gender nvarchar(20) NULL)

GO

-- table of certificates
CREATE TABLE dbo.Certificate(
	CertificateID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Certificate nvarchar(10) NOT NULL)

GO

-- table of countries
CREATE TABLE dbo.Country(
	CountryID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Country nvarchar(255) NOT NULL)

GO

-- table of directors
CREATE TABLE dbo.Director(
	DirectorID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	FirstName nvarchar(100) NOT NULL,
	FamilyName nvarchar(100) NULL,
	FullName  AS (FirstName+isnull(' '+FamilyName,'')),
	DoB datetime NULL,
	DoD datetime NULL,
	Gender nvarchar(20) NULL)

GO

-- table of films
CREATE TABLE dbo.Film(
	FilmID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Title nvarchar(255) NOT NULL,
	ReleaseDate datetime NULL,
	DirectorID int NULL,
	StudioID int NULL,
	Review nvarchar(max) NULL,
	CountryID int NULL,
	LanguageID int NULL,
	GenreID int NULL,
	RunTimeMinutes smallint NULL,
	CertificateID int NULL,
	BudgetDollars bigint NULL,
	BoxOfficeDollars bigint NULL,
	OscarNominations tinyint NULL,
	OscarWins tinyint NULL)

GO

-- table of genres
CREATE TABLE dbo.Genre(
	GenreID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Genre nvarchar(50) NOT NULL)

GO

-- table of languages
CREATE TABLE dbo.Language(
	LanguageID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Language nvarchar(255) NOT NULL)

GO

-- table of roles
CREATE TABLE dbo.Role(
	RoleID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Role nvarchar(255) NULL,
	FilmID int NULL,
	ActorID int NULL)

GO

-- table of studios
CREATE TABLE dbo.Studio(
	StudioID int IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Studio nvarchar(255) NOT NULL)

GO

