INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (1, N'Jurassic Park', CAST(N'1993-06-11T00:00:00.000' AS DateTime), 4, 41, N'People clone dinosaurs. Dinosaurs promptly eat people. Hilarity ensues! Wait, not hiliarity, the other one, horror! Yes, that''s it, horror.', 241, 1, 8, 126, 2, 63000000, 1029939903, 3, 3)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (2, N'Spider-Man', CAST(N'2002-05-03T00:00:00.000' AS DateTime), 11, 53, N'High-school nerd Peter Parker is bitten by a genetically engineered spider leading to him developing super powers and transforming into Spider-Man! Cue much dreary teenage angst and some nonsense about great responsi-blah-bity. Shut up already and punch some bad guys you weed.', 241, 1, 4, 121, 4, 140000000, 821708551, 2, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (3, N'King Kong', CAST(N'2005-12-14T00:00:00.000' AS DateTime), 12, 42, N'Dizzy blonde actress falls for drippy writer on an adventure with an ambitious film director. Oh, and something about a big monkey. Sorry, ape.', 167, 1, 8, 187, 4, 207000000, 550500000, 4, 3)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (5, N'Superman Returns', CAST(N'2006-07-14T00:00:00.000' AS DateTime), 14, 43, N'The Man of Steel returns from a sabbatical to discover that nobody gives a rat''s a**. Except for Lois Lane who apparently cared about him so much that she ran off and had a kid with some other dude. Seriously, Bryan Singer gave up X-Men for this drivel. What was he thinking?!', 241, 1, 4, 154, 4, 204000000, 391081192, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (6, N'Titanic', CAST(N'1998-01-23T00:00:00.000' AS DateTime), 15, 4, N'Bleurgh! Sorry, that''s the sound of me vomiting. Coincidentally it''s also my opinion of this abysmal, cynical, money-making machine. If you enjoy this film you are a horrible human being and should be ashamed of yourself.', 241, 1, 6, 194, 3, 200000000, 2186772302, 14, 11)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (7, N'Evan Almighty', CAST(N'2007-06-22T00:00:00.000' AS DateTime), 16, 44, N'Morgan Freeman is God. Steve Carell tries to be funny. There''s also a giant boat made of wood. Depressingly, the boat upstages most of the cast.', 241, 1, 7, 96, 2, 175000000, 173418781, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (8, N'Waterworld', CAST(N'1995-07-28T00:00:00.000' AS DateTime), 17, 45, N'Kevin Costner grows a pair of gills! This instantly makes him 100% more interesting than any of the other parts he has ever played. Unfortunately this still puts him at zero on the interesting scale. Dennis Hopper also hams it up as The Baddie. You can tell he''s a baddie ''cos he''s only got one eye.', 241, 1, 8, 135, 3, 175000000, 264218220, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (9, N'Pearl Harbor', CAST(N'2001-05-21T00:00:00.000' AS DateTime), 18, 7, N'NEEEEEOWWM!!! BOOM!!! DAKKA DAKKA DAKKA!!! Is how the original script written by Michael Bay read. Fortunately some other, sane, people added some actual dialogue to the script. Unfortunately, most of this dialogue is delivered by Ben Affleck and Josh Hartnett. First he giveth, then he taketh away.', 241, 1, 5, 183, 3, 140000000, 449220945, 4, 1)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (10, N'Transformers', CAST(N'2007-07-03T00:00:00.000' AS DateTime), 18, 46, N'Michael Bay is a terrible director. But he brought back Transformers! And he got Peter Cullen to reprise his 1980s role as Optimus Prime! Sadly, he failed to cast Frank Welker as Megatron. And he hired Shia "I need a massive punch in the face" LaBoeuf and Megan "I''m Angelina Jolie without the class or talent" Fox. You suck Michael Bay.', 241, 1, 3, 144, 4, 150000000, 709709780, 3, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (11, N'Harry Potter and the Order of the Phoenix', CAST(N'2007-07-11T00:00:00.000' AS DateTime), 19, 47, N'Not watched it but isn''t this the one where Gary Oldman dies? Killing off your best character there, bravo Rowling, bravo.', 240, 1, 12, 138, 4, 150000000, 939885929, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (12, N'Beowulf', CAST(N'2007-11-16T00:00:00.000' AS DateTime), 20, 48, N'One of the greatest literary works of Anglo-Saxon Old English is mangled by the raspy cockernee voice of a man so ugly he had to be replaced by CGI.', 241, 1, 12, 115, 4, 150000000, 196393745, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (13, N'Bee Movie', CAST(N'2007-11-02T00:00:00.000' AS DateTime), 21, 8, N'Not watched it.', 241, 1, 11, 91, 1, 150000000, 287594577, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (14, N'Pirates of the Caribbean: At World''s End', CAST(N'2007-05-25T00:00:00.000' AS DateTime), 22, 3, N'Honestly, I stopped paying attention after the first one. I think this is the one where Legolas gets stabbed but then comes back as an undead ship captain. So he''s basically turned into a zombie fisherman. Like Jesus.', 241, 1, 8, 168, 4, 300000000, 963420425, 2, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (15, N'I Am Legend', CAST(N'2007-12-14T00:00:00.000' AS DateTime), 23, 49, N'Will Smith spends months capturing vampires to cure them instead of trying to stake them through the heart. It is thus completely his own fault that he dies in the end. Unless you watch the alternate ending in which he lives happily ever after. Because Hollywood.', 241, 1, 10, 100, 5, 150000000, 585349010, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (16, N'Ratatouille', CAST(N'2007-06-22T00:00:00.000' AS DateTime), 24, 3, N'"There''s a rat in my kitchen what am I gonna do?"
The answer, apparently, is to appoint him head chef. Who knew?', 241, 1, 11, 111, 1, 150000000, 623722818, 5, 1)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (17, N'Troy', CAST(N'2004-05-14T00:00:00.000' AS DateTime), 25, 50, N'The single most amazing fact about this film is that Sean Bean is in it and he doesn''t die! Some of the swordfights are pretty spectacular. Other than that, it''s pretty rubbish.', 241, 1, 8, 162, 5, 175000000, 497409852, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (18, N'Harry Potter and the Goblet of Fire', CAST(N'2005-11-06T00:00:00.000' AS DateTime), 26, 47, N'Not seen it, but it''s probably rubbish.', 240, 1, 12, 156, 4, 150000000, 896911078, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (19, N'Batman Begins', CAST(N'2005-06-15T00:00:00.000' AS DateTime), 27, 43, N'Spoilt little man child Christian Bale plays spoilt little man child Bruce Wayne. Bruce begins the film on the worst gap year in history;  homeless, destitute and imprisoned. Then he gets beaten up by ninjas and you find out his mum and dad were killed when he was a little boy. You feel sorry for Bruce. Then his personal butler arrives to collect him in his private jet and takes him back to his castle and you find it impossible to sympathise with Bruce ever again.
Fun fact: I used to live in the village of Mentmore, next door to Mentmore Towers, the huge mansion that was used as Wayne Manor in the film.', 241, 1, 4, 141, 4, 150000000, 374218673, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (20, N'Charlie and the Chocolate Factory', CAST(N'2005-07-15T00:00:00.000' AS DateTime), 28, 49, N'This film wishes it was as good as Willy Wonka and the Chocolate Factory. It isn''t. It isn''t even close.', 241, 1, 12, 115, 2, 150000000, 474968763, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (21, N'Pirates of the Caribbean: Dead Man''s Chest', CAST(N'2006-07-06T00:00:00.000' AS DateTime), 22, 3, N'It''s ok. Not as good as the first one though.', 241, 1, 8, 151, 4, 225000000, 1066179725, 4, 1)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (22, N'Die Another Day', CAST(N'2002-11-20T00:00:00.000' AS DateTime), 29, 51, N'Too many gadgets, not enough of Bond punching people. Away with you Brosnan, and take your silly invisible car with you.', 240, 1, 9, 133, 4, 142000000, 431971116, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (23, N'Lethal Weapon 4', CAST(N'1998-07-10T00:00:00.000' AS DateTime), 30, 52, N'The least believable film of the series, mainly due to Jet Li being beaten up by Mel Gibson. Nonsense! In Jet Li''s country, Gibson would already be dead. Also, Danny Glover is still too old for this s***.', 241, 1, 4, 127, 5, 100000000, 285444603, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (24, N'Armageddon', CAST(N'1998-07-01T00:00:00.000' AS DateTime), 18, 7, N'One of the very few films I''ve had to stop watching part way through because it was so terrible. I''ve still never seen it to the end and can only hope that the asteroid won so that everybody involved in this dreadful film died horrible, violent deaths.', 241, 1, 3, 151, 3, 140000000, 553709788, 4, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (25, N'Men in Black II', CAST(N'2002-07-03T00:00:00.000' AS DateTime), 31, 41, N'Meh. It was ok, not as good as the first.', 241, 1, 3, 89, 2, 140000000, 441818803, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (26, N'Spider-Man 3', CAST(N'2007-05-04T00:00:00.000' AS DateTime), 11, 53, N'Attempts to spice up dreary Tobey Maguire''s performance by turning him into Goth-Spiderman fail miserably. Tobey remains dreary, film remains uninteresting.', 241, 1, 4, 139, 4, 258000000, 890871626, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (27, N'Spider-Man 2', CAST(N'2004-06-30T00:00:00.000' AS DateTime), 11, 53, N'I know that I''ve watched this but I genuinely can''t remember a thing about it. I don''t know why Alfred Molina wasted his time and talent on it.', 241, 1, 4, 127, 4, 200000000, 783766341, 3, 1)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (28, N'Stealth', CAST(N'2005-08-05T00:00:00.000' AS DateTime), 32, 54, N'Of the many things in my life for which I am grateful, the fact that I have never seen Stealth ranks right up there.', 241, 1, 4, 121, 4, 135000000, 76932872, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (29, N'Final Fantasy: The Spirits Within', CAST(N'2001-08-03T00:00:00.000' AS DateTime), 33, 55, N'Never played the game, never watched the film.', 241, 1, 11, 106, 2, 137000000, 85131830, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (30, N'Miami Vice', CAST(N'2006-07-28T00:00:00.000' AS DateTime), 34, 1, N'It didn''t get the best reviews, but I like Michael Mann''s more subdued take on the 80''s extravagance of its source material.', 241, 1, 9, 134, 5, 135000000, 163794509, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (31, N'The World Is Not Enough', CAST(N'1999-11-26T00:00:00.000' AS DateTime), 35, 51, N'Robert Carlyle can''t feel pain. Denise Richards can''t act. I can''t bear to watch this film whenever it''s on TV.', 240, 1, 9, 128, 3, 135000000, 361832400, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (32, N'Master and Commander: The Far Side of the World', CAST(N'2003-11-14T00:00:00.000' AS DateTime), 36, 4, N'I found this surprisingly entertaining. I''d watch a sequel but sadly they aren''t making one.', 241, 1, 8, 138, 4, 150000000, 212011111, 10, 2)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (33, N'War of the Worlds', CAST(N'2005-06-29T00:00:00.000' AS DateTime), 4, 41, N'I watched this as a relatively dumb, big-budget sci-fi flick. I''ve since realised that it''s an intelligent and damning critique of the immense stupidity of the anti-vaccination crowd. On an unrelated note, did we ever find out what happened to Tom Cruise''s sweet ''68 Ford Mustang?', 241, 1, 3, 116, 4, 132000000, 591745540, 3, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (34, N'The Bourne Ultimatum', CAST(N'2007-08-17T00:00:00.000' AS DateTime), 37, 56, N'It''s still good, but it lacks the impact that the first film had. Except for the part where Matt Damon jumps down a stairwell onto a fat guy. That was a pretty good impact.', 241, 1, 9, 115, 4, 110000000, 442824138, 3, 3)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (35, N'Harry Potter and the Prisoner of Azkaban', CAST(N'2004-05-31T00:00:00.000' AS DateTime), 38, 47, N'They definitely made too many of these films. Not seen it, don''t care.', 240, 1, 12, 141, 2, 130000000, 796688549, 2, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (36, N'The Matrix Reloaded', CAST(N'2003-05-15T00:00:00.000' AS DateTime), 39, 49, N'I kind of feel sorry for the Wachowskis. They''d made the absolute perfect sci-fi movie in The Matrix, how could a sequel ever hope to live up to the original''s reputation? It didn''t. Still worth a watch though. Unlike the third one.', 241, 1, 3, 138, 5, 150000000, 742128461, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (37, N'The Da Vinci Code', CAST(N'2006-05-19T00:00:00.000' AS DateTime), 40, 20, N'I have watched this and it still amazes me how so many talented people can produce a film that''s just so "meh".', 241, 1, 18, 146, 4, 125000000, 758239851, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (38, N'Harry Potter and the Philosopher''s Stone', CAST(N'2001-11-16T00:00:00.000' AS DateTime), 41, 47, N'Filmum es stinkum! Away with you Potter and take your faux-Latin voodoo with you. If I wanted to see a bunch of amateurish child actors stumbling over lines of basic English I''d go and watch my nephew''s school play.', 240, 1, 12, 152, 2, 125000000, 974800000, 3, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (39, N'The Day After Tomorrow', CAST(N'2004-05-26T00:00:00.000' AS DateTime), 42, 57, N'Dennis Quaid saves the world. The End.', 241, 1, 9, 124, 4, 125000000, 542772402, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (40, N'Pirates of the Caribbean: Curse of the Black Pearl', CAST(N'2003-07-09T00:00:00.000' AS DateTime), 22, 3, N'Forget the ever-growing nonsense of the other films in the series - this first one is great. The story is as sophisticated as you''d expect from a film based on a fairground ride but it''s just as entertaining.', 241, 1, 8, 135, 3, 140000000, 654264015, 5, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (41, N'The Last Samurai', CAST(N'2003-12-05T00:00:00.000' AS DateTime), 43, 58, N'I desperately want to hate this film for its reliance on borderline-racist tropes: the mystical savage, the noble white hunter, it''s basically Dances with Wolves in Japan. However, I adore samurai movies and this is a spectacular one, as much for its quiet, introspective moments as for the blood and fury battle scenes. Reading around the subject of the Meiji Restoration and the Satsuma Rebellion is highly recommended to get the most out of this film.', 241, 1, 8, 154, 5, 140000000, 456758981, 4, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (42, N'The Perfect Storm', CAST(N'2000-06-30T00:00:00.000' AS DateTime), 25, 6, N'Tiny Boat vs. Enormous Angry Ocean. Boat loses.', 241, 1, 8, 130, 3, 120000000, 328718434, 2, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (43, N'Mission: Impossible III', CAST(N'2006-05-04T00:00:00.000' AS DateTime), 44, 59, N'I have seen it but all I can remember is the very beginning and the very end. Nothing inbetween. It''s probably ok.', 241, 1, 9, 125, 4, 150000000, 397850012, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (44, N'Mission: Impossible II', CAST(N'2000-05-24T00:00:00.000' AS DateTime), 45, 59, N'You can tell that John Woo directed this because at one point there is a joust. Using motorbikes.', 241, 1, 9, 123, 5, 125000000, 546388105, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (45, N'Windtalkers', CAST(N'2002-08-30T00:00:00.000' AS DateTime), 45, 60, N'I''ve seen it but can''t remember it. John Woo directed though, so there''s probably a dove in there somewhere.', 241, 1, 5, 134, 5, 115000000, 77628265, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (46, N'Star Wars: Episode II - Attack of the Clones', CAST(N'2002-05-16T00:00:00.000' AS DateTime), 7, 13, N'Oh god, just when you thought that nobody could be worse than the horrible little child who played Anakin Skywalker in the previous film they get Hayden Christensen - a man so untalented as an actor that he delivered his lines as though he hadn''t quite learned to read. Dreadfull, dreadful, dreadful.', 241, 1, 3, 142, 2, 115000000, 649400000, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (47, N'Monsters, Inc.', CAST(N'2002-02-08T00:00:00.000' AS DateTime), 46, 10, N'Ahh, just adorable. Some people think that you need to have children in order to justify watching films like this. You don''t.', 241, 1, 11, 92, 1, 115000000, 562800000, 4, 1)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (48, N'Star Wars: Episode I - The Phantom Menace', CAST(N'1999-05-19T00:00:00.000' AS DateTime), 7, 13, N'I had such high hopes for this. I remember watching the online trailer over and over in the tiny window of Apple Quicktime Player on my mate''s PC over the dodgy university network. How were we to know that the trailer would be infinity times better than the actual film. A sad, sad day. The sole redeeming feature is the best lightsaber duel of all of the films so far, between an actual real martial artist in Ray Park and Ewan McGregor. The rest of it? I still try to pretend that it doesn''t exist.', 241, 1, 3, 133, 1, 115000000, 1027000000, 3, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (49, N'Star Wars: Episode III - Revenge of the Sith', CAST(N'2005-05-19T00:00:00.000' AS DateTime), 7, 13, N'When Hayden Christensen attempts to act, he looks as though he''s trying to understand advanced string theory. I think he''d make a more believable theoretical physicist than he does an actor. The only good thing about this film is that it''s the final Star Wars movie in which George Lucas had any sort of control.', 241, 1, 3, 140, 4, 113000000, 848800000, 1, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (50, N'The Matrix Revolutions', CAST(N'2003-11-05T00:00:00.000' AS DateTime), 39, 49, N'Just... No.', 241, 1, 3, 129, 5, 150000000, 427343298, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (51, N'Tomorrow Never Dies', CAST(N'1997-12-12T00:00:00.000' AS DateTime), 47, 51, N'Apart from Live and Let Die and Moonraker, this must be my most watched Bond film. Not because I particularly like it, but because it''s the only one they ever seem to show on British TV.', 240, 1, 9, 119, 3, 110000000, 333011068, 0, 0)
INSERT dbo.Film (FilmID, Title, ReleaseDate, DirectorID, StudioID, Review, CountryID, LanguageID, GenreID, RunTimeMinutes, CertificateID, BudgetDollars, BoxOfficeDollars, OscarNominations, OscarWins) VALUES (52, N'Ocean''s Eleven', CAST(N'2002-02-15T00:00:00.000' AS DateTime), 48, 61, N'I don''t remember anything about this film.', 241, 1, 14, 117, 3, 85000000, 450717150, 0, 0)
